import React from 'react'
import { useState, useEffect } from 'react'

function App() {

  const[post,setPost] = useState("")
  useEffect(
    function getPost(){
      fetch('https://jsonplaceholder.typicode.com/todos/1')
        .then(response => response.json())
        .then(json => setPost())
    },[post] )


  return (
    <>
      <div>App</div>
      <button onClick={getPost}>get post</button>
    </>
  )
}

export default App
